import { useState } from "react";
import "../styles/form.css";

function SignupForm() {

  const [isLoggedin, setIsLoggedin] = useState(false);


  // password visibility

  const [isVisible, setVisible] = useState(false);

  let visibility_icon = isVisible ? "" : " ";
  let input_type = isVisible ? "text" : "password";

  function togglePasswordVisibilty() {
    if (!isVisible) {
      setVisible(true);
    } else setVisible(false);
  }

  // input states

  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [passwordConfimation, setPasswordConfirmation] = useState("");


  let handleNameInput = (name) => {
    setName(name);
  };

  let handleEmailInput = (email) => {
    setEmail(email);
  };

  let handlePasswordInput = (password) => {
    setPassword(password);
  };

  let handlePasswordConfirmationInput = (password) => {
    setPasswordConfirmation(password);
  };


  let handleSignUp = () => {
    console.log({
      name: name,
      email: email,
      password: password,
    });

    if(password !== passwordConfirmation) {

    }
    setIsLoggedin(true);
  };

  return (
    <main className="form-container">
      <form>
        {" "}
        <h1 className="form-title">Sign Up</h1>
        <div className="form-group">
          <input
            onChange={(e) => {
              handleNameInput(e.target.value);
            }}
            type="text"
            name="name"
            value={name}
            placeholder="..."
            required
          />
          <label for="name" className="label-name">
            <span className="content-name">Name</span>
          </label>
          <div className="verification-icon-cont"></div>
          <div className="error-msg-container">
            <h6>Invalid email address</h6>
          </div>
        </div>
        <div className="form-group">
          <input
            onChange={(e) => {
              handleEmailInput(e.target.value);
            }}
            type="email"
            name="name"
            value={email}
            placeholder="..."
            required
          />
          <label for="name" className="label-name">
            <span className="content-name">Email</span>
          </label>
          <div className="verification-icon-cont"></div>
          <div className="error-msg-container">
            <h6>Invalid name</h6>
          </div>
        </div>
        <div className="form-group">
          <input
            onChange={(e) => {
              handlePasswordInput(e.target.value);
            }}
            type={input_type}
            name="name"
            value={password}
            placeholder="..."
            required
          />
          <label for="name" className="label-name">
            <span className="content-name">Password</span>
          </label>
          <div
            onClick={() => {
              togglePasswordVisibilty();
            }}
            className="verification-icon-cont"
          ></div>
          <div className="error-msg-container">
            <h6>invalid password</h6>
          </div>
        </div>
      <div className="form-group">
          <input
            onChange={(e) => {
              handlePasswordConfirmationInput(e.target.value);
            }}
            type={input_type}
            name="name"
            value={passwordConfimation}
            placeholder="..."
            required
          />
          <label for="name" className="label-name">
            <span className="content-name">Confirm password</span>
          </label>
          <div
            onClick={() => {
              togglePasswordVisibilty();
            }}
            className="visibility-icon-cont"
          ></div>
          <div className="error-msg-container">
            <h6>invalid password</h6>
          </div>
        </div>
        <div className="checkbox-container">
            <input type="checkbox" required/>
            <h5>I Agree with privacy and policy</h5>
        </div>
        <button
          onClick={(e) => {
            handleSignUp();
          }}
          className="form-button"
        >
          SIGN UP
          {isLoggedin && (
            <div className="loader-container">
              <div className="ball"></div>
              <div className="ball"></div>
              <div className="ball"></div>
            </div>
          )}
        </button>
        <h4 className="redirect-msg">Already have an account? <span>Sign in</span></h4>
      </form>
    </main>
  );
}

export default SignupForm;
